import NavBar from './Components/Layout/NavBar'
import TodoList from './TO-DO/TodoList';
import TodoForm from './TO-DO/To-Do-Item/ToDoForm';



function App() {
  return (
   <Fragment>
     <header>
     <NavBar />
     </header>
<main>
<TodoList/>
</main>

<footer>
  <TodoForm />
</footer>


   </Fragment>
  );
}

export default App;
